import React, { Component } from 'react';
import 'tachyons';

class Team extends Component
{
    render()
    {
        return (
          <div>
            <h1 className="tc fw9 f-headline lh-solid">Our Vision</h1>
          </div>
        );
    }
}

export default Team;
